import React from "react";
import { Card } from "react-bootstrap";
import { connect } from "react-redux";
import { getallStrmes } from "../actions/index";
class ListStream extends React.Component {
  componentDidMount() {
    this.props.getallStrmes();
  }

  rendeList() {
    console.log("sdfgn", this.props);
    this.props.strems.map((item) => {
      return (
        <>
          <Card>
            <h2>{item.title}</h2>
            <p>{item.discription}</p>
          </Card>
        </>
      );
    });
  }

  render() {
    return (
      <div>
        <h1>List streame</h1>
        {this.rendeList()}
      </div>
    );
  }
}
const mapstatetoProps = (state) => {
  console.log("satte", state.strmes);
  return { strems: Object.values(state.strmes) };
};
export default connect(mapstatetoProps, { getallStrmes })(ListStream);
